window.bookSummaryJSON = "<p>When curvy grad student Emma Fischer is stranded in the south of France, she’s short on cash and unable to speak French. The last people she expects to come to her aide at the train station are two high-demand fashion models in France for a photo shoot. Sparks fly between the threesome as they speed toward Paris in their private car. </p> <p>Emma gets on the train a girl, but the intimate time spent in the dominant men’s arms over one hot weekend turns her into a woman. Walking away from her lovers to return to her average life in Wisconsin is one of the hardest things she’s ever done.</p> <p>Jaxson Davidson and Chase Cartwright have been best friends and business partners for years. As A-list models they are treated like royalty wherever they go, by everyone they meet, which is why their down-to-earth submissive grad student, Emma, is something special. The men have been seeking a way to turn their friendship into a romance, and Emma is the perfect missing ingredient to make that happen.</p> <p>Can a romance that started as a fun summer fling turn into something long lasting for the trio? Will Jaxson’s powerful father ruin their chance at their own happily ever after? Find out this and more in this sexy, exciting ménage novel where love might really be the only thing more powerful than the paparazzi. </p> <p>Publisher’s note: <i>Infamous Love</i> is a M/m/f erotic ménage romance meant for adult audiences only.</p>"; 
